import React from "react";
import Styles from "./SubMenu.module.scss";

const SubMenu = ({titles, open}) => {

    return (
        <div className={open ? Styles.wrapperOpen : Styles.wrapperClosed}>
            {titles}
       </div>
    );
}

export default SubMenu;
